import Card from "../../../UI/Card/Card";
import Title from "../../../UI/Title/Title";
import SubTitle from "../../../UI/SubTitle/SubTitle";
import InputCheckbox from "../../../UI/InputCheckbox/InputCheckbox";
import SearchOptionTime from "./SearchOptionTime/SearchOptionTime";
import SearchOptionPrice from "./SearchOptionPrice/SearchOptionPrice";
import SearchOptionCategory from "./SearchOptionCategory/SearchOptionCategory";

import style from "./SearchOption.module.css";

const checkboxTime = [
  { text: "today", value: 0 },
  { text: "yesterady", value: 1 },
  { text: "three days ago", value: 3 },
  { text: "a week ago", value: 7 },
  { text: "a month ago", value: 30 },
  { text: "three months ago", value: 90 },
  { text: "a year ago", value: 100 },
  { text: "0 ~ $100", value: [0, 100] },
  { text: "$100 ~ $300", value: [100, 300] },
  { text: "$300 ~ $500", value: [300, 500] },
  { text: "$500 ~ $1000", value: [500, 1000] },
  { text: "above $1000", value: [1000, Infinity] },
];

function SearchOption() {
  return (
    <Card className={style.searchOption}>
      <Title>search by</Title>
      <div className={style["search__container"]}>
        <SearchOptionTime />
        <SearchOptionPrice />
        {/* <SearchOptionCategory /> */}
      </div>
    </Card>
  );
}

export default SearchOption;
